description:
Celeste and Jesse have been best friends forever. They dated in high school, got married, and now theyre getting divorced. Their best friends dont think they can maintain their friendship throughout the dissolution of their marriage, but Celeste and Jesse dont think there will be a problem. But thats before Jesse gets into a relationship that Celeste doesnt think he can handle, and Celeste finds it harder to move on than she originally thought.

